import { Text, StyleSheet } from "react-native";

const Title = ({ title }) => {
  return <Text style={styles.title}>{title}</Text>;
};

const styles = StyleSheet.create({
  title: {
    marginTop: 200,
    marginBottom: 33,
    fontWeight: 500,
    fontSize: 30,
    letterSpacing: 0.01,
  },
});

export default Title;
